package net.cltech.middleware.domain;

import net.cltech.middleware.interfaces.DriverConfiguration;

/**
 *
 *
 * @author bcortes
 * @version 1.0.0
 * @since 11-09-2023
 * @see Creación
 */
public class DriverParameters implements DriverConfiguration
{

    @Override
    public String getDriverName()
    {
        return "Maglumi";
    }

    @Override
    public String getDriverManufacturer()
    {
        return "Velez-Lab";
    }

    @Override
    public String getDriverVersion()
    {
        return "1.0.0";
    }

    @Override
    public String getDriverProtocol()
    {
        return "ASTM";
    }

    @Override
    public String getDriverInfo()
    {
        return "- Analizador de Inmunología.\n"
                + "- Protocolo ASTM por líneas.\n"
                + "- HostQuery.\n"
                + "- Comunicación Serial.";
    }

    @Override
    public String getDriverImage()
    {
        String a = "";
        String b = "";
        String c = "";
        return a+b+c;
    }

    @Override
    public DriverConfig getDriverConfiguration()
    {
        String titleOption1 = null;
        String option1[] = null;
        String titleOption2 = null;
        String option2[] = null;
        String titleOption3 = null;
        String titleOption4 = null;
        String option3 = null;
        String option4 = null;
        boolean qc = true;
        boolean microbiology = false;
        boolean loadSheet = false;
        boolean images = false;
        TestColumn COLUMNS[] = new TestColumn[]
        {
            new TestColumn("Code", true, "input", null, true),
            new TestColumn("type", true, "combo", new String[]
            {
                "Numeric", "Interpret"
            }, true),
            null
        };
        DriverConfig CONFIG = new DriverConfig(COLUMNS, titleOption1, titleOption2, titleOption3, titleOption4, option1, option2, option3, option4, qc, microbiology, loadSheet, images, false);
        return CONFIG;
    }
}
